import React from "react";

export const ProfileInfo = () => {
  return (
    <div style={{ margin: "10px" }}>
      <p style={{ fontWeight: "bold", textAlign: "center" }}>
        <img src="/photo.jpg" alt="My Image" width="100" height="100"></img>
      </p>
    </div>
  );
};
